import React from 'react';
import classes from './Button.module.css'
import {SvgButton} from './svgButton'



interface Props {
	id: string;
}


export const Button = ({ id }: Props) => {

	switch (id) {
		case 'button_CreateTask':
			return (

				<button className={classes.button} name="Create_Task" value="clicked" type="button">CREATE TASK</button>
			)


			case 'button_LogOut':
				return (
					<button className={classes.button} name="Log_Out" value="clicked" type="button"><SvgButton id="logout_icon"/>LOG OUT</button>
				)
	



			default:
				return <button></button>;
	
	
		}
	}
